import React from "react";
import defaultLogo from "../Resources/Images/defaultLogo.png";

function Profile() {
  return (
    <div className="profileContainer">
      <img src={defaultLogo} width="200px" alt="123" />
      <label id="profileName">Yair Gabay</label>
      <label id="description">
        Now is the winter of our discontent Made glorious summer by this sun of
        York;
      </label>
    </div>
  );
}

export default Profile;
